import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Header from './components/Header';
import AdminHeader from './components/AdminHeader'; // Ensure this path is correct
import Home from './pages/HomeScreen';
import Blog from './pages/BlogScreen';
import Services from './pages/ServicesScreen';
import Book from './pages/BookingScreen';
import FAQs from './pages/FAQs';
import Confirmation from './pages/ConfirmationScreen';
import Payment from './pages/PaymentScreen';
import BookingSummary from './pages/BookingSummary';
import AdminLayout from './components/AdminLayout'; // Ensure this path is correct
import AdminDashboard from './pages/AdminDashboard'; // Example admin page
import AdminBookings from './pages/AdminBookings'; // Example admin page
import AdminUsers from './pages/AdminUsers'; // Example admin page

const App = () => {
  return (
    <Router>
      <Routes>
        {/* Public Routes */}
        <Route path="/" element={<Header />}>
          <Route index element={<Home />} />
          <Route path="blogs" element={<Blog />} />
          <Route path="services" element={<Services />} />
          <Route path="booking" element={<Book />} />
          <Route path="faqs" element={<FAQs />} />
          <Route path="confirmation" element={<Confirmation />} />
          <Route path="payment" element={<Payment />} />
          <Route path="booking-successful" element={<BookingSummary />} />
        </Route>

        {/* Admin Routes */}
        <Route path="/admin" element={<AdminLayout />}>
          <Route path="dashboard" element={<AdminDashboard />} />
          <Route path="bookings" element={<AdminBookings />} />
          <Route path="users" element={<AdminUsers />} />
          {/* Add more admin routes here */}
        </Route>
      </Routes>
    </Router>
  );
};

export default App;
